      PROCEDURESOURCE: | 
        CREATE OR ALTER PROCEDURE USR$SAN_P_ANKLEJOINT 
        RETURNS ( 
            ID SMALLINT,
            NAME VARCHAR(120))
         AS
        BEGIN
          ID = 1;
          NAME = 'Контур кортикального слоя медиальной и латеральной лодыжки';
          SUSPEND;
        
          ID = 2;
          NAME = 'Контур суставной поверхности таранной кости';
          SUSPEND;
          
          ID = 3;
          NAME = 'Гиалиновый хрящ передней суставной поверхности таранной кости';
          SUSPEND;
        
          ID = 4;
          NAME = 'Верхний заворот';
          SUSPEND;
        
          ID = 5;
          NAME = 'Полость голеностопного сустава';
          SUSPEND;
        
          ID = 6;
          NAME = 'Внутрисуставная жидкость';
          SUSPEND;
        
          ID = 7;
          NAME = 'Синовиальная оболочка';
          SUSPEND;
        
          ID = 8;
          NAME = 'Дистальный межберцовый синдесмоз';
          SUSPEND;
        
          ID = 9;
          NAME = 'Связки медиального отдела сустава';
          SUSPEND;
        
          ID = 10;
          NAME = 'Связки латерального отдела стопы';
          SUSPEND;
        
          ID = 11;
          NAME = 'Ахиллово сухожилие';
          SUSPEND;
        
        
        END
